import React from "react";

const Artist = () => {

return(
    <>


        <div className="header">
        </div>

        <div className="container">
            <div className="row">
                <div className="col-10 col-offset-2 col-lg-6">
                <div className="card">
                <img src="https://storage.googleapis.com/ehimages/2017/10/25/img_942b5703ed4c5d3b242a34f7cc87d9c0_1508933938684_processed_original.jpg" alt="mypic" className="card_img" />
                <div className="card_info">
                    <span className="card_category text-white text-white"> Category  </span>
                    <h3 className="car_title text-white text-white"> Title </h3>
                    <a href="https://storage.googleapis.com/ehimages/2017/10/25/img_942b5703ed4c5d3b242a34f7cc87d9c0_1508933938684_processed_original.jpg" >
                        <button className="btn btn-warning">Visit Profile</button>
                    </a>
                </div>
            </div>
                </div>
            </div>
        </div>
    </>
);
};
export default Artist;
